import React, { Component } from 'react';
import './App.css';
import Todos from './components/Todos'
class App extends Component {

  state = {
    todos: [
      { id: 1,
        title:'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Dinner with wife',
        completed: false
      },
      {
        id:3,
        title: 'Meeting with boss',
        completed: false
      }
    ]
  }
  render() {
    return this.props.todos.map((todo) => (
      <h3>{todo.title}</h3>
    ))
  }
}

export default App;
